        if (clicked) {
            console.log("true");
            imageOrder.forEach((img, index) => {
                // console.log(imageOrder[index].clicked);
                imageOrder[index].clicked = false;
                // console.log(imageOrder[index].clicked);
            });
            return this.setState({
                image: imageOrder.sort(() => Math.random() - 0.5),
                topScore: this.state.counter,
                counter: 0
            })
        }
